import React from 'react'
import './Sidebar.css'
import TwitterIcon from '@mui/icons-material/Twitter';

const Sidebar = () => {
  return (
    <div className='sidebar'>
      <TwitterIcon className='side'/>
    </div>
  )
}

export default Sidebar
